import React from 'react';
import {Avatar} from "@material-ui/core";

import "./Sidechat.css";
function Sidechat() {
    return (
        <div className="sidechat">
            <Avatar src="https://avatars.dicebear.com/api/human/584223.svg"></Avatar>
            <div className="sidechat_info">
            <h2>UserName</h2>
            <p>This is my last message...</p>
            </div>
        </div>
    )
}

export default Sidechat
